import { Card, CardContent } from "@mui/material";
import television from "../public/assets/images/television.svg";

export const CustomCard = (props) => {
  const { Info, ...other } = props;

  return (
    <>
      <Card>
        <CardContent>
          <Typography>Enjoy on your TV</Typography>
          <Typography>
            Watch on smart TVs, PlayStation, Xbox, Chromecast, Apple TV, Blu-ray
            players and more.
          </Typography>
        </CardContent>
        <CardMedia
          sx={{ height: 140 }}
          component="img"
          image={television} // Use the imported URL here
          title="Television"
        />
      </Card>
    </>
  );
};

export default CustomCard;
